import { NavLink } from 'react-router-dom';

function NavMain() {
    return (
        <nav className="nav-main">
            <ul>
                <li>
                    <NavLink to='/' exact>Movie</NavLink>
                </li>
                <li>
                    <NavLink to='/about'>About</NavLink>
                </li>

            </ul>
        </nav>
    )
}

export default NavMain
